var minOperations = function(nums1, nums2) {
    let operations = 0;
    if (nums1[nums1.length - 1] === Math.max(...nums1) && nums2[nums2.length - 1] === Math.max(...nums2)) {
        return 0; // No operations needed
    }

    // Check for swapping opportunities
    if (nums1[nums1.length - 1] < Math.max(...nums2)) {
        operations++;
        let swapIndex = nums2.indexOf(Math.max(...nums2));
        [nums1[nums1.length - 1], nums2[swapIndex]] = [nums2[swapIndex], nums1[nums1.length - 1]];
    }

    if (nums2[nums2.length - 1] < Math.max(...nums1)) {
        operations++;
        let swapIndex = nums1.indexOf(Math.max(...nums1));
        [nums2[nums2.length - 1], nums1[swapIndex]] = [nums1[swapIndex], nums2[nums2.length - 1]];
    }

    // Validate if conditions are met
    if (nums1[nums1.length - 1] !== Math.max(...nums1) || nums2[nums2.length - 1] !== Math.max(...nums2)) {
        return -1; // Conditions cannot be met
    }

    return operations;
};
